SP_Dual.Params.LogToConsole=0#关闭控制台输出子问题的求解记录


LB=[0]#下界
    
U0=[999999]
UB=999999
cut=0
I=0
while UB-LB[0]>0.01:#迭代循环
    a=0
    b=0
    c=0
    while a<10:
        while b<5:
            while c<10:
                SP_Dual.setObjective(PV[a][b][c]*Z[a,b,c].x*Vduall+sum(Z[a,b,l].x*Vdualu[l] for l in Route)+sum((Z[a,b,l].x-1)*Vdualv[l] for l in Route),GRB.MAXIMIZE)
                SP_Dual.addConstr(sum(Vdualv[l] for l in Route)+sum(Vdualw[l] for l in Route)>=0-sum(Demand[a]*Possibility[i]*Judge[a][b][c][i]*temp[i] for i in Segs),name="E")
                SP_Dual.addConstrs((PV[a][b][l]*Vduall+Vdualu[l]+Vdualv[l]+Vdualw[l]<=0 for l in Route),name="C")
                SP_Dual.optimize()
                SP_Dual_obj[a][b][c] = SP_Dual.objVal 
                if SP_Dual_obj[a][b][c]>g[a,b,c].x+0.000000001:
                    m.addConstr(PV[a][b][c]*Z[a,b,c]*Vduall.x+sum(Z[a,b,l]*Vdualu[l].x for l in Route)+sum((Z[a,b,l]-1)*Vdualv[l].x for l in Route)<=g[a,b,c],name="S")
                    cut=cut+1
                SP_Dual.remove(SP_Dual.getConstrs())
                SP_Dual.update()
                c = c+1
            b = b+1
            c = 0
        a = a+1
        b = 0
        c = 0
    U0[0]=sum(Open[f].x*Fixed[f] for f in Facility)+Var+Cof*sum(SP_Dual_obj[p][f][k] for p in Plant for f in Facility for k in Route )#更新上界
    if U0[0]<UB:
        UB=U0[0]
    m.optimize()#求解主问题
    I=I+1
    LB[0]=m.objVal#更新下界
    print('LB=%g'% LB[0])
    print('UB=%g'% UB)
    print(100*(UB-LB[0])/UB)
    print(int(time.time())-time_start)
    if(int(time.time())>=time_end):
        break


